import axios from "axios";

const userRegion = localStorage.getItem("userRegion");

const fetchReportsTypeByPlayerNickname = (nickname) => {
    const url = 'http://localhost:8080/api/v1/players/reportsType?username='+nickname+'&region='+userRegion;
    return axios.get(url).then(
        (response) => {
            return response
        }
    );
};
